var request = new XMLHttpRequest()
request.open('GET', 'https://hamiltonchristianschool.apps.school.nz/alerts.php?API_KEY=976350c0ed8bf52b97cbf3914c2779f5&version=2.4.0', true)
request.onload = function() {
  // Begin accessing JSON data here
  var data = JSON.parse(this.response)
  if (request.status >= 200 && request.status < 400) {
    data.slice(0, 25).forEach(app => {
      const card = document.createElement('div')
      card.setAttribute('class', 'card')

      const h4 = document.createElement('h4')
      h4.textContent = app.header

      const p = document.createElement('div')
      p.innerHTML = `${app.description}`
      
      var unixtimestamp = app.date;
      var months_arr = ['Jan','Feb','Mar','Apr','May','Jun','Jul','Aug','Sep','Oct','Nov','Dec'];
      var date = new Date(unixtimestamp*1000);
      var year = date.getFullYear();
      var month = months_arr[date.getMonth()];
      var day = date.getDate();
      var hours = date.getHours();
      var minutes = "0" + date.getMinutes();
      var ampm = 'AM';
      
      if (hours > 12) {
		h = hours - 12;
		ampm = 'PM';
	} else if (hours === 12) {
		h = 12;
		ampm = 'PM';
	} else if (hours == 0) {
		h = 12;
	}
      
      var convdataTime = day+' '+month+' '+year+' - '+hours + ':' + minutes.substr(-2) + ampm;
      
      const datetime = document.createElement('h5')
      datetime.textContent = convdataTime
      
      const box = document.getElementById('container')
      
      box.appendChild(card)
      card.appendChild(h4)
      card.appendChild(datetime)
      card.appendChild(p)
    })
  } else {
    const errorMessage = document.createElement('marquee')
    errorMessage.textContent = `Error`
    app.appendChild(errorMessage)
  }
}


request.send();
